DIFFS = [ [1, 0], [-1, 0], [0, 1], [0, -1] ]
import functools
class Solution:
    def trapRainWater(self, heightMap):
        height = len(heightMap)
        width = len(heightMap[0])

        # for each cell, I want to know the shortest bottleneck height
        @functools.lru_cache(None)
        def dp(r, c, count):
            # print(f'dp called on r: {r} c: {c} count: {count}')
            # base case
            if r == height - 1 or r == 0 or c == width - 1 or c == 0:
                # print(f'base case, ret height: {heightMap[r][c]}')
                return heightMap[r][c]
            # if r == height - 1 or r == 0 or c == width - 1 or c == 0:
            #     return 0 # we can fall out the edge

            if count > 400:
                # print(f'termininating due to count')
                return float('inf')

            resDp = float('inf')

            for rowDiff, colDiff in DIFFS:
                newRow = rowDiff + r
                newCol = colDiff + c
                # skip higher cells
                # if heightMap[newRow][newCol] > heightMap[r][c]:
                #     resDp = min(resDp, heightMap[newRow][newCol])
                #     continue
                resDp = min(resDp, dp(newRow, newCol, count + 1))
            # print(f'final res dp for r={r} c={c} count={count} is: {resDp}')

            return max(resDp, heightMap[r][c])

        # dp(1, 1, 0)
        # return

        res = 0
        for r in range(height):
            for c in range(width):
                bottleneck = dp(r, c, 0)
                # print(f'bottleneck for r:{r} c:{c} is: {bottleneck}')
                stored = max(0, bottleneck - heightMap[r][c])
                res += stored
        return res


Sol = Solution()
